function validation(values){
    alert("")
    let error = {}
    const email_pattern = /^[^s@]+@[^\s@]+\.[^\s@]+$/
    const password_pattern = /^(?=.*\d)(?=.*[A-Z])[a-zA-Z0-9](8,)$/
    if(values.email === ""){
        error.email = "Name should not be empty"
    }
    else if(!email_pattern-test(values.email)){
        error.email = "Email didn"
    }
}
